Dear Requester:

&nbsp;

We reviewed your request as follows:

&nbsp;

All contacts, MOUs and order forms with Flock Safety (aka Flock Group) between 1/1/2023 and 1/12/2026.

&nbsp;

Your request was made under the California Public Records Act (CPRA). The Department is cognizant of its responsibilities under the CPRA. It recognizes the statutory scheme was enacted to maximize citizen access to the workings of government. The CPRA does not mandate disclosure of all documents within the government’s possession. Rather, by specific exemption and reference to other statutes, the CPRA recognizes that there are boundaries where the public’s right to access must be balanced against such weighty considerations as the right of privacy, a right of constitutional dimension under California Constitution, Article 1, Section 1. The law also exempts from disclosure records that are privileged or confidential or otherwise exempt under either express provisions of the CPRA or pursuant to applicable federal or state law, per California Government Code Sections 7927.200; 7927.700; 7923.600-7923.625; 7927.705; and 7922.000.

&nbsp;

The Department has completed its review and is providing you with records responsive to your request.

&nbsp;

Please note that under Section 7920.530 of the CPRA, “public records” includes any writing containing information relating to the conduct of the public’s business and excludes writings containing or consisting of personal information unrelated to governmental activities. Similarly, Sections 7927.700 and 7922.000 exempt records the disclosure of which would constitute an unwarranted invasion of personal privacy and/or would not serve the public interest. Therefore, responsive records containing personal information are being provided to you with redactions.&nbsp;

&nbsp;

If you have any questions, please respond to this email.

&nbsp;

Respectfully,

&nbsp;

